          setOpen(false);
        }
      }
    //const anchorRef = React.useRef(null);

    render(){
        let {avatar,name}=this.props;

        console.log("name",name)

        let {open} =this.state;

        return(
            <div className="header-class">
                <div className="header-title">基于区块链的光网络建设管理平台</div>
                <div className="header-avater-private">
                    <Button ref={this.anchorRef}
                        aria-controls={open ? 'menu-list-grow' : undefined}
                        aria-haspopup="true"
                        onClick={this.handleToggle}>
                    <Avatar variant="circle" alt={name}
                    style={{
                        color: '#f56a00',
                        backgroundColor: '#fde3cf',
                      }}
                    >
                        {name}
                    </Avatar>
                    </Button>
                    <Popper open={open} anchorEl={anchorRef.current} role={undefined} transition disablePortal>
                        {({ TransitionProps, placement }) => (
                            <Grow
                            {...TransitionProps}
                            style={{ transformOrigin: placement === 'bottom' ? 'center top' : 'center bottom' }}
                            >
                            <Paper>
                                <ClickAwayListener onClickAway={this.handleClose}>
                                <MenuList autoFocusItem={open} id="menu-list-grow" onKeyDown={this.handleListKeyDown}>
                                    <MenuItem onClick={this.handleClose}>Profile</MenuItem>
                                    <MenuItem onClick={this.handleClose}>My account</MenuItem>
                                    <MenuItem onClick={this.handleClose}>Logout</MenuItem>
                                </MenuList>
                                </ClickAwayListener>
                            </Paper>
                            </Grow>
                        )}
                    </Popper>


                </div>
            </div>
        )
    }
}

export default HeaderPrivate
